import logo from "./logo.svg";
import "./App.css";
import { publicRoutes } from "./Routes";

const App = () => {
  return (
    <div className="App" style={{ backgroundColor: "#141D37", color: "black" }}>
      <Navbar />
      <Routes>
        {publicRoutes.map((route, idx) => (
          <Route path={route.path} element={<route.component />} key={idx} />
        ))}
      </Routes>
    </div>
  );
};

export default App;
